import React, { Component } from "react";
import AddTodo from "./AddTodo";
import Todolist from "./TodoList";
import ActionsComponet from "./ActionsComponent";
class TodoContainer extends Component {
  render() {
    return (
      <div>
        <AddTodo />
        <Todolist />
        <ActionsComponent />
      </div>
    );
  }
}

export default TodoContainer;
